Kieran, I hope you have been receiving my emails!

 

I'll keep this one short. I'm eager to consider you for our next
incoming class at Wilmington College in Ohio, and I have several
_priority status_ advantages to offer when you submit your Application
for Admission [
https://learn.go-wilmington.org/f/r/0a90c5a89271c49cf51f89aaf?%2Fc3RhcnRVUkw9JTJGQXBwbHklMkZUYXJnZXRYX1BvcnRhbF9fUEI%2FdXRtX2NhbXBhaWduPWZhc3QmdXRtX3NvdXJjZT1lbnJvbGwzNjBfYXBwbHkmdXRtX21lZGl1bT1lbWFpbCZ1dG1fY29udGVudD1hcHBseSZ0bm50PTIxNjA0OTk2LTBkODgtNDJlOC04ODZiLWZlYjFlY2I2YWJhZSZVVE1fcmNyZD0zYWQ2ODNkNi00Yzc0LTQ0YjQtYjE5ZC1iYjgwNGFlZDg0ZDkiO30%3D&
] or the Common App [
https://learn.go-wilmington.org/f/r/e0d4e40137f0704c14cbde677?%3D&
].

* No application fee
* No required essay or recommendation
* Optional test-score submission
* Automatic scholarship consideration

Remember that you will also receive an accelerated admission decision,
which means you'll have plenty of time to consider your options —
and I think you will definitely want to consider WC!

 

Your Fightin' Quaker future is waiting, Kieran. Take
a moment and apply to WC today with our Application for Admission [
https://learn.go-wilmington.org/f/r/0a90c5a89271c49cf51f89aaf?%2Fc3RhcnRVUkw9JTJGQXBwbHklMkZUYXJnZXRYX1BvcnRhbF9fUEI%2FdXRtX2NhbXBhaWduPWZhc3QmdXRtX3NvdXJjZT1lbnJvbGwzNjBfYXBwbHkmdXRtX21lZGl1bT1lbWFpbCZ1dG1fY29udGVudD1hcHBseSZ0bm50PTIxNjA0OTk2LTBkODgtNDJlOC04ODZiLWZlYjFlY2I2YWJhZSZVVE1fcmNyZD0zYWQ2ODNkNi00Yzc0LTQ0YjQtYjE5ZC1iYjgwNGFlZDg0ZDkiO30%3D&
] or the Common App [
https://learn.go-wilmington.org/f/r/e0d4e40137f0704c14cbde677?%3D&
].

 

Sincerely,

 

